INSERT INTO public.animals VALUES (1, 'Rex', 1, 2, '2020-03-15', 'samec', 'Nádherný německý ovčák, velmi přátelský a poslušný. Miluje dlouhé procházky a hraní si s míčem. Je to skvělý hlídač a nejlepší přítel celé rodiny.', 'rex-nemecky-ovcak', true, 2, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (2, 'Bella', 1, 3, '2021-07-20', 'samice', 'Krásná zlatá retrívr, velmi milá a energická. Zbožňuje vodu a aportování. Je skvělá s dětmi a má nekonečnou trpělivost.', 'bella-zlaty-retrivr', true, 3, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (3, 'Max', 1, 4, '2019-11-08', 'samec', 'Statný rottweiler s obrovským srdcem. Vypadá jako drsňák, ale je to největší mazlíček. Skvělý hlídač a ochránce rodiny.', 'max-rottweiler', true, 4, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (4, 'Luna', 2, 2, '2021-05-12', 'samice', 'Elegantní perská kočka s dlouhým hedvábným kožíškem. Velmi klidná a majestátní. Miluje pohlazení a spaní na slunečním parapetu.', 'luna-perska-kocka', true, 2, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (5, 'Whiskers', 2, 5, '2020-09-03', 'samec', 'Hravý mainský mýval s impozantní velikostí a krásným kožíškem. Velmi inteligentní a sociální kočka, která si rozumí i se psy.', 'whiskers-mainsky-myval', true, 5, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (6, 'Bobík', 3, 3, '2022-01-15', 'samec', 'Roztomilý lop králík s dlouhýma ušima. Velmi klidný a přátelský. Miluje mrkev a petržel, rád poskakuje po zahradě.', 'bobik-lop-kralik', true, 3, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (8, 'Pepíček', 4, 5, '2022-06-10', 'samec', 'Veselá andulka s krásným modrým zbarvením. Velmi mluvný a společenský. Umí říct několik slov a napodobuje různé zvuky.', 'pepicek-andulka-modra', true, 5, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (9, 'Ořešek', 5, 2, '2022-03-25', 'samec', 'Roztomilé morče s hnědým kožíškem připomínajícím ořech. Velmi aktivní a zvídavé. Miluje čerstvou zeleninu a vydává roztomilé zvuky.', 'oresek-morce-hnede', true, 2, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (10, 'Zlatíčko', 6, 3, '2023-02-14', 'samice', 'Malý zlatý křeček s velkými tmavými očky. Velmi aktivní, hlavně v noci. Miluje běhání v kolečku a sbírání potravy do lícních váčků.', 'zlaticko-krecek-zlaty', true, 3, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (11, 'Duhový', 7, 4, '2023-05-01', 'samec', 'Krásná gupka s duhově přelivajícími se ploutkami. Velmi klidná a elegantní rybka. Skvělá do společenského akvária.', 'duhovy-gupka-samec', true, 4, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (12, 'Pomalka', 8, 5, '2018-08-30', 'samice', 'Majestátní vodní želva s krásnými červenými skvrnami za očima. Velmi klidná a moudrá. Miluje slunění na kameni a plavání.', 'pomalka-zelva-vodní', true, 5, '2025-11-02 02:06:15.944+00', '2025-11-02 02:06:15.944+00');
INSERT INTO public.animals VALUES (7, 'Sněhurka', 4, 4, '2021-12-20', 'samice', 'Krásná bílá králice s růžovýma očima. Velmi něžná a klidná, skvělá pro děti. Má nejjemnější kožíšek a miluje hlazení.', 'snehurka-bila-kralice', true, 4, '2025-11-02 02:06:15.944+00', '2025-11-02 13:05:13.673+00');
